        },
        {
            thumbnail:"",
            channelIcon:"",
            title:"",
            channelname:"",
            views:"",
        }
    ]
    return ( 
        <div className="videos">
            {videos.map((data)=>{
                return(
                <div className="video">
                    <div className="thumb">
                        <img src={data.thumbnail} alt="" />
                    </div>
                    <div className="details">
                        <div className="cicon">
                            <img src={data.channelIcon} alt="" />
                        </div>
                        <div className="title">
                            <span id='title'>{data.title}</span><br />
                            <span>{data.channelname}</span><br />
                            <span>{data.views}</span>
                        </div>
                    </div>
                </div>    
            )})}

        </div>
     );
}
 
export default Video;
